import { createIcon } from "../icon/createIcon";

export const RemoveIcon = createIcon(
  <svg viewBox="0 0 12 12" data-testid="RemoveIcon">
    <path d="M11 5v2H1V5h10z" />
  </svg>,
  "Remove",
  "remove"
);
